import React from 'react';

const ProgressTracker = ({ progress }) => {
    return (
        <div>
            <h2>Progress Tracker</h2>
            <p>Correct Answers: {progress.correct}</p>
            <p>Questions Attempted: {progress.total}</p>
        </div>
    );
};

export default ProgressTracker;
